    const [name,setName]=useState({
        firstname:"",
        lastname:""
    })
    const [object,setObject]=useState([])

    const handleinput=(e)=>{
        setName({...name,[e.target.name]:e.target.value})
    }
    const submit =()=>{
        setObject(name)
        console.log(object)
