        <table border='1px solid black' className='margin-top-20px'>

        {
            object.map((val)=>(
                <>
                val.firstname
                </>
            ))
         }
        <tr>
        <th>FIRST NAME</th>
        <th>SECOND NAME</th>
        </tr>
        <tr>
        <td>     {object.firstname}  </td>
        <td>       {object.lastname}    </td>
        </tr>
        </table>
        </>
    )
}
export default FormTask
